-- 初始化数据库表结构 --

CREATE TABLE Ad (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, beginDate date DEFAULT NULL, content clob, endDate date DEFAULT NULL, path varchar2(255 char) DEFAULT NULL, title varchar2(255 char) NOT NULL, type number(10,0) NOT NULL, url varchar2(255 char) DEFAULT NULL, adPosition_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Admin (department varchar2(255 char) DEFAULT NULL, email varchar2(255 char) NOT NULL, encodedPassword varchar2(255 char) NOT NULL, name varchar2(255 char) DEFAULT NULL, username varchar2(255 char) NOT NULL, id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Admin_Role (admins_id number(19,0) NOT NULL, roles_id number(19,0) NOT NULL, PRIMARY KEY (admins_id, roles_id))
CREATE TABLE AdPosition (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, description varchar2(255 char) DEFAULT NULL, height number(10,0) NOT NULL, name varchar2(255 char) NOT NULL, template clob NOT NULL, width number(10,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Area (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, fullName clob NOT NULL, grade number(10,0) NOT NULL, name varchar2(255 char) NOT NULL, treePath varchar2(255 char) NOT NULL, parent_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
CREATE TABLE AreaFreightConfig (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, continuePrice number (21, 6) NOT NULL, continueWeight number(10,0) NOT NULL, firstPrice number (21, 6) NOT NULL, firstWeight number(10,0) NOT NULL, shippingMethod_id number(19,0) NOT NULL, store_id number(19,0) NOT NULL, area_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Article (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, author varchar2(255 char) DEFAULT NULL, content clob, hits number(19,0) NOT NULL, isPublication number(1,0) NOT NULL, isTop number(1,0) NOT NULL, seoDescription varchar2(255 char) DEFAULT NULL, seoKeywords varchar2(255 char) DEFAULT NULL, seoTitle varchar2(255 char) DEFAULT NULL, title varchar2(255 char) NOT NULL, articleCategory_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Article_ArticleTag (articles_id number(19,0) NOT NULL, articleTags_id number(19,0) NOT NULL, PRIMARY KEY (articles_id, articleTags_id))
CREATE TABLE ArticleCategory (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, grade number(10,0) NOT NULL, name varchar2(255 char) NOT NULL, seoDescription varchar2(255 char) DEFAULT NULL, seoKeywords varchar2(255 char) DEFAULT NULL, seoTitle varchar2(255 char) DEFAULT NULL, treePath varchar2(255 char) NOT NULL, parent_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
CREATE TABLE ArticleTag (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, icon varchar2(255 char) DEFAULT NULL, memo varchar2(255 char) DEFAULT NULL, name varchar2(255 char) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Attribute (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, name varchar2(255 char) NOT NULL, options clob NOT NULL, propertyIndex number(10,0) NOT NULL, productCategory_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE AuditLog (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, action varchar2(255 char) NOT NULL, detail varchar2(255 char) DEFAULT NULL, ip varchar2(255 char) NOT NULL, parameters clob, requestUrl varchar2(255 char) NOT NULL, user_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
CREATE TABLE Brand (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, introduction clob, logo varchar2(255 char) DEFAULT NULL, name varchar2(255 char) NOT NULL, type number(10,0) NOT NULL, url varchar2(255 char) DEFAULT NULL, PRIMARY KEY (id))
CREATE TABLE Business (attributeValue0 varchar2(255 char) DEFAULT NULL, attributeValue1 varchar2(255 char) DEFAULT NULL, attributeValue10 varchar2(255 char) DEFAULT NULL, attributeValue11 varchar2(255 char) DEFAULT NULL, attributeValue12 varchar2(255 char) DEFAULT NULL, attributeValue13 varchar2(255 char) DEFAULT NULL, attributeValue14 varchar2(255 char) DEFAULT NULL, attributeValue15 varchar2(255 char) DEFAULT NULL, attributeValue16 varchar2(255 char) DEFAULT NULL, attributeValue17 varchar2(255 char) DEFAULT NULL, attributeValue18 varchar2(255 char) DEFAULT NULL, attributeValue19 varchar2(255 char) DEFAULT NULL, attributeValue2 varchar2(255 char) DEFAULT NULL, attributeValue3 varchar2(255 char) DEFAULT NULL, attributeValue4 varchar2(255 char) DEFAULT NULL, attributeValue5 varchar2(255 char) DEFAULT NULL, attributeValue6 varchar2(255 char) DEFAULT NULL, attributeValue7 varchar2(255 char) DEFAULT NULL, attributeValue8 varchar2(255 char) DEFAULT NULL, attributeValue9 varchar2(255 char) DEFAULT NULL, balance number (27, 12) NOT NULL, bankAccount varchar2(255 char) DEFAULT NULL, bankName varchar2(255 char) DEFAULT NULL, email varchar2(255 char) NOT NULL, encodedPassword varchar2(255 char) NOT NULL, frozenFund number (27, 12) NOT NULL, idCard varchar2(255 char) DEFAULT NULL, idCardImage varchar2(255 char) DEFAULT NULL, identificationNumber varchar2(255 char) DEFAULT NULL, legalPerson varchar2(255 char) DEFAULT NULL, licenseImage varchar2(255 char) DEFAULT NULL, licenseNumber varchar2(255 char) DEFAULT NULL, mobile varchar2(255 char) DEFAULT NULL, name varchar2(255 char) DEFAULT NULL, organizationCode varchar2(255 char) DEFAULT NULL, organizationImage varchar2(255 char) DEFAULT NULL, phone varchar2(255 char) DEFAULT NULL, safeKeyExpire date DEFAULT NULL, safeKeyValue varchar2(255 char) DEFAULT NULL, taxImage varchar2(255 char) DEFAULT NULL, username varchar2(255 char) NOT NULL, id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE BusinessAttribute (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, isEnabled number(1,0) NOT NULL, isRequired number(1,0) NOT NULL, name varchar2(255 char) NOT NULL, options clob, pattern varchar2(255 char) DEFAULT NULL, propertyIndex number(10,0) DEFAULT NULL, type number(10,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE BusinessDepositLog (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, balance number (21, 6) NOT NULL, credit number (21, 6) NOT NULL, debit number (21, 6) NOT NULL, memo varchar2(255 char) DEFAULT NULL, type number(10,0) NOT NULL, business_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Cart (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, expire date DEFAULT NULL, cartKey varchar2(255 char) NOT NULL, member_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
CREATE TABLE CartItem (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, quantity number(10,0) NOT NULL, cart_id number(19,0) NOT NULL, sku_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Cash (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, account varchar2(255 char) NOT NULL, amount number (21, 6) NOT NULL, bank varchar2(255 char) NOT NULL, status number(10,0) NOT NULL, business_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE CategoryApplication (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, rate double precision NOT NULL, status number(10,0) NOT NULL, productCategory_id number(19,0) NOT NULL, store_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Consultation (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, content varchar2(255 char) NOT NULL, ip varchar2(255 char) NOT NULL, isShow number(1,0) NOT NULL, forConsultation_id number(19,0) DEFAULT NULL, member_id number(19,0) DEFAULT NULL, product_id number(19,0) NOT NULL, store_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Coupon (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, beginDate date DEFAULT NULL, endDate date DEFAULT NULL, introduction clob, isEnabled number(1,0) NOT NULL, isExchange number(1,0) NOT NULL, maximumPrice number (21, 6) DEFAULT NULL, maximumQuantity number(10,0) DEFAULT NULL, minimumPrice number (21, 6) DEFAULT NULL, minimumQuantity number(10,0) DEFAULT NULL, name varchar2(255 char) NOT NULL, point number(19,0) DEFAULT NULL, prefix varchar2(255 char) NOT NULL, priceExpression varchar2(255 char) DEFAULT NULL, store_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
