CREATE TABLE DefaultFreightConfig (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, continuePrice number (21, 6) NOT NULL, continueWeight number(10,0) NOT NULL, firstPrice number (21, 6) NOT NULL, firstWeight number(10,0) NOT NULL, shippingMethod_id number(19,0) NOT NULL, store_id number(19,0) NOT NULL, PRIMARY KEY (id))
