CREATE TABLE MemberAttribute (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, isEnabled number(1,0) NOT NULL, isRequired number(1,0) NOT NULL, name varchar2(255 char) NOT NULL, options clob, pattern varchar2(255 char) DEFAULT NULL, propertyIndex number(10,0) DEFAULT NULL, type number(10,0) NOT NULL, PRIMARY KEY (id))
