it varchar2(255 char) DEFAULT NULL, weekHits number(19,0) NOT NULL, weekHitsDate date NOT NULL, weekSales number(19,0) NOT NULL, weekSalesDate date NOT NULL, weight number(10,0) DEFAULT NULL, brand_id number(19,0) DEFAULT NULL, productCategory_id number(19,0) NOT NULL, store_id number(19,0) NOT NULL, storeProductCategory_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
