CREATE TABLE ProductNotify (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, email varchar2(255 char) NOT NULL, hasSent number(1,0) NOT NULL, member_id number(19,0) DEFAULT NULL, sku_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE ProductTag (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, icon varchar2(255 char) DEFAULT NULL, memo varchar2(255 char) DEFAULT NULL, name varchar2(255 char) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Promotion (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, beginDate date DEFAULT NULL, conditionsAmount number (21, 6) DEFAULT NULL, conditionsNumber number(10,0) DEFAULT NULL, creditAmount number (21, 6) DEFAULT NULL, creditNumber number(10,0) DEFAULT NULL, discount double precision DEFAULT NULL, endDate date DEFAULT NULL, image varchar2(255 char) DEFAULT NULL, introduction clob, isCouponAllowed number(1,0) NOT NULL, isEnabled number(1,0) NOT NULL, isFreeShipping number(1,0) NOT NULL, maximumPrice number (21, 6) DEFAULT NULL, maximumQuantity number(10,0) DEFAULT NULL, minimumPrice number (21, 6) DEFAULT NULL, minimumQuantity number(10,0) DEFAULT NULL, name varchar2(255 char) NOT NULL, priceExpression varchar2(255 char) DEFAULT NULL, title varchar2(255 char) NOT NULL, type number(10,0) NOT NULL, store_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Promotion_Coupon (promotions_id number(19,0) NOT NULL, coupons_id number(19,0) NOT NULL, PRIMARY KEY (promotions_id, coupons_id))
CREATE TABLE Promotion_MemberRank (promotions_id number(19,0) NOT NULL, memberRanks_id number(19,0) NOT NULL, PRIMARY KEY (promotions_id, memberRanks_id))
CREATE TABLE Promotion_Sku (giftPromotions_id number(19,0) NOT NULL, gifts_id number(19,0) NOT NULL, PRIMARY KEY (giftPromotions_id, gifts_id))
CREATE TABLE PromotionPluginSvc (promotionPluginId varchar2(255 char) DEFAULT NULL, id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Receiver (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, address varchar2(255 char) NOT NULL, areaName varchar2(255 char) NOT NULL, consignee varchar2(255 char) NOT NULL, isDefault number(1,0) NOT NULL, phone varchar2(255 char) NOT NULL, zipCode varchar2(255 char) NOT NULL, area_id number(19,0) NOT NULL, member_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Review (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, content varchar2(255 char) NOT NULL, ip varchar2(255 char) NOT NULL, isShow number(1,0) NOT NULL, score number(10,0) NOT NULL, forReview_id number(19,0) DEFAULT NULL, member_id number(19,0) NOT NULL, product_id number(19,0) NOT NULL, store_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Role (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, description varchar2(255 char) DEFAULT NULL, isSystem number(1,0) NOT NULL, name varchar2(255 char) NOT NULL, permissions clob NOT NULL, PRIMARY KEY (id))
CREATE TABLE Seo (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, description varchar2(255 char) DEFAULT NULL, keywords varchar2(255 char) DEFAULT NULL, title varchar2(255 char) DEFAULT NULL, type number(10,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE ShippingMethod (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, description varchar2(255 char) DEFAULT NULL, icon varchar2(255 char) DEFAULT NULL, name varchar2(255 char) NOT NULL, defaultDeliveryCorp_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
CREATE TABLE ShippingMethod_PaymentMethod (shippingMethods_id number(19,0) NOT NULL, paymentMethods_id number(19,0) NOT NULL, PRIMARY KEY (shippingMethods_id, paymentMethods_id))
CREATE TABLE Sku (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, allocatedStock number(10,0) NOT NULL, cost number (21, 6) DEFAULT NULL, exchangePoint number(19,0) NOT NULL, isDefault number(1,0) NOT NULL, marketPrice number (21, 6) NOT NULL, price number (21, 6) NOT NULL, rewardPoint number(19,0) NOT NULL, sn varchar2(255 char) NOT NULL, specificationValues clob, stock number(10,0) NOT NULL, product_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Sn (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, lastValue number(19,0) NOT NULL, type number(10,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE SocialUser (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, loginPluginId varchar2(255 char) NOT NULL, uniqueId varchar2(255 char) NOT NULL, user_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
CREATE TABLE Specification (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, name varchar2(255 char) NOT NULL, options clob NOT NULL, productCategory_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Statistic (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, day number(10,0) NOT NULL, month number(10,0) NOT NULL, type number(10,0) NOT NULL, value number (21, 6) NOT NULL, year number(10,0) NOT NULL, store_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
CREATE TABLE StockLog (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, inQuantity number(10,0) NOT NULL, memo varchar2(255 char) DEFAULT NULL, outQuantity number(10,0) NOT NULL, stock number(10,0) NOT NULL, type number(10,0) NOT NULL, sku_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Store (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, address varchar2(255 char) DEFAULT NULL, bailPaid number (27, 12) NOT NULL, discountPromotionEndDate date DEFAULT NULL, email varchar2(255 char) NOT NULL, endDate date NOT NULL, fullReductionPromotionEndDate date DEFAULT NULL, introduction clob, isEnabled number(1,0) NOT NULL, keyword varchar2(255 char) DEFAULT NULL, logo varchar2(255 char) DEFAULT NULL, mobile varchar2(255 char) NOT NULL, name varchar2(255 char) NOT NULL, phone varchar2(255 char) DEFAULT NULL, status number(10,0) NOT NULL, type number(10,0) NOT NULL, zipCode varchar2(255 char) DEFAULT NULL, business_id number(19,0) NOT NULL, storeCategory_id number(19,0) NOT NULL, storeRank_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Store_ProductCategory (stores_id number(19,0) NOT NULL, productCategories_id number(19,0) NOT NULL, PRIMARY KEY (stores_id, productCategories_id))
CREATE TABLE StoreAdImage (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, image varchar2(255 char) NOT NULL, title varchar2(255 char) DEFAULT NULL, url varchar2(255 char) DEFAULT NULL, store_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE StoreCategory (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, bail number (21, 6) NOT NULL, name varchar2(255 char) NOT NULL, PRIMARY KEY (id))
CREATE TABLE StoreFavorite (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, member_id number(19,0) NOT NULL, store_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE StoreProductCategory (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, grade number(10,0) NOT NULL, name varchar2(255 char) NOT NULL, treePath varchar2(255 char) NOT NULL, parent_id number(19,0) DEFAULT NULL, store_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE StoreProductTag (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, icon varchar2(255 char) DEFAULT NULL, isEnabled number(1,0) NOT NULL, memo varchar2(255 char) DEFAULT NULL, name varchar2(255 char) NOT NULL, store_id number(19,0) NOT NULL, PRIMARY KEY (id))
CREATE TABLE StoreRank (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, orders number(10,0) DEFAULT NULL, isAllowRegister number(1,0) NOT NULL, memo varchar2(255 char) DEFAULT NULL, name varchar2(255 char) NOT NULL, quantity number(19,0) DEFAULT NULL, serviceFee number (21, 6) NOT NULL, PRIMARY KEY (id))
CREATE TABLE Svc (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, amount number (21, 6) NOT NULL, durationDays number(10,0) DEFAULT NULL, sn varchar2(255 char) NOT NULL, store_id number(19,0) DEFAULT NULL, PRIMARY KEY (id))
CREATE TABLE Users (id number(19,0) NOT NULL, createdDate date NOT NULL, lastModifiedDate date NOT NULL, version number(19,0) NOT NULL, isEnabled number(1,0) NOT NULL, isLocked number(1,0) NOT NULL, lastLoginDate date DEFAULT NULL, lastLoginIp varchar2(255 char) DEFAULT NULL, lockDate date DEFAULT NULL, PRIMARY KEY (id))

